<script src="https://cdn.jsdelivr.net/npm/canvas-confetti@1.5.1/dist/confetti.browser.min.js"></script>
<script>
  document.addEventListener("DOMContentLoaded", function () {
    const checkButton = document.getElementById("checkButton");
    const buttonText = document.getElementById("buttonText");
    const buttonSpinner = document.getElementById("buttonSpinner");
    const confettiContainer = document.getElementById("confetti-container");
    const mainContent = document.querySelector(".lg\\:pt-14");
    const congratulationsPage = document.getElementById("congratulationsPage");
    const loanFeesPage = document.getElementById("loanFeesPage");
    const mobileInput = document.getElementById("mobileNumber");
    const appInput = document.getElementById("appNumber");
    const mobileError = document.getElementById("mobileError");
    const appError = document.getElementById("appError");
    const loanFeesBtn = document.getElementById("loanFeesBtn");
    const backToCongratsBtn = document.getElementById("backToCongratsBtn");
    const downloadApprovalBtn = document.getElementById("downloadApprovalBtn");
    const termsCheckbox = document.getElementById("terms");

    // Validate form and show loader
    checkButton.addEventListener("click", () => {
      // Reset errors
      mobileError.classList.add("hidden");
      appError.classList.add("hidden");

      let isValid = true;

      // Removed checkbox validation - users can proceed without checking terms

      // Validate mobile number
      if (!mobileInput.value || mobileInput.value.length < 10) {
        mobileError.classList.remove("hidden");
        isValid = false;
      }

      // Validate application number
      if (!appInput.value) {
        appError.classList.remove("hidden");
        isValid = false;
      }

      if (!isValid) return;

      // Show loading spinner on button
      buttonText.textContent = "Processing...";
      buttonSpinner.classList.remove("hidden");
      checkButton.disabled = true;

      // Prepare form data
      const formData = new FormData();
      formData.append('mobile_number', mobileInput.value);
      formData.append('application_number', appInput.value);

      // Make API call to check loan status
      fetch('check_loan_status.php', {
        method: 'POST',
        body: formData
      })
      .then(response => response.json())
 .then(data => {
        if (data.success) {
            // Loan found - show celebration
            showCelebration();
            sessionStorage.setItem('loanData', JSON.stringify(data.loan));
            
            // Update the loan details page with the fetched data
            updateLoanDetails(data.loan);
        } else {
            // Loan not found - show error
            Swal.fire({
                icon: 'error',
                title: 'Loan Not Found',
                text: data.message || 'No loan found with these details. Please contact admin.',
                confirmButtonText: 'OK',
                customClass: {
                    confirmButton: 'my-confirm-btn'
                }
            });
        }
    })
      .catch(error => {
        console.error('Error:', error);
        Swal.fire({
          icon: 'error',
          title: 'Error',
          text: 'An error occurred while checking your loan status',
          confirmButtonText: 'OK',
          customClass: {
            confirmButton: 'my-confirm-btn'
          }
        });
      })
      .finally(() => {
        buttonText.textContent = "Check";
        buttonSpinner.classList.add("hidden");
        checkButton.disabled = false;
      });
    });

    function updateLoanDetails(loanData) {
        // Update loan summary section
        document.querySelector('[data-loan-amount]').textContent = `${formatNumber(loanData.amount)}`;
        document.querySelector('[data-interest-rate]').textContent = `${loanData.interest_rate}%`;
        document.querySelector('[data-tenure]').textContent = `${loanData.tenure} months`;
        document.querySelector('[data-emi]').textContent = `${formatNumber(loanData.emi)}`;
        document.querySelector('[data-processing-fee]').textContent = `${formatNumber(loanData.processing_fee)}`;

    }


    function formatNumber(num) {
        return new Intl.NumberFormat('en-IN').format(num);
    }


    function showCelebration() {
      mainContent.classList.add("hidden");
      congratulationsPage.classList.remove("hidden");
      document.body.style.overflow = "hidden";

      setTimeout(() => {
        const confetti = confetti.create(confettiContainer, {
          resize: true,
          useWorker: true,
        });

        confetti({
          particleCount: 200,
          spread: 90,
          origin: { y: 0.6 },
        });

        setTimeout(() => {
          confetti({
            particleCount: 100,
            spread: 120,
            origin: { x: 0.3, y: 0.7 },
            colors: ["#ff0000", "#00ff00", "#0000ff"],
          });
        }, 300);

        setTimeout(() => {
          confetti({
            particleCount: 100,
            spread: 120,
            origin: { x: 0.7, y: 0.7 },
            colors: ["#ffff00", "#ff00ff", "#00ffff"],
          });
        }, 600);
      }, 200);
    }

    loanFeesBtn.addEventListener("click", () => {
      congratulationsPage.classList.add("hidden");
      loanFeesPage.classList.remove("hidden");
    });

    downloadApprovalBtn.addEventListener("click", () => {
      const loanData = JSON.parse(sessionStorage.getItem('loanData'));
      if (loanData && loanData.id) {
        window.open(`application.php?id=${loanData.id}`);
      } else {
        window.open('application.php');
      }
    });

    backToCongratsBtn.addEventListener("click", () => {
      loanFeesPage.classList.add("hidden");
      congratulationsPage.classList.remove("hidden");
      document.body.style.overflow = "hidden";
    });
  });
</script>
